import ExpenseItem from "./ExpenseItem"
import './ExpenseItem'

export default function ExpenseItems({items}) {

return (
    <ul>
        {items.map((item) => 
            <ExpenseItem 
                key={item.id} 
                title={item.title} 
                amount={item.amount} 
                date={item.date} 
            />
        )}
    </ul>
    )
}
